      SELECT DISTINCT - col2 * + col0 + + - CAST ( + col2 AS INTEGER ) + col0 * - 94 + col1 AS col0 FROM tab2 AS cor0 WHERE NOT + 6 IS NULL;
  - name: tab2

outputs:
